const { createAsyncThunk } = require("@reduxjs/toolkit");

export const fetchData = createAsyncThunk(
  "rootReducer/fetchQuestions",
  async () => {
    try {
      const response = await fetch("/api");
      return response.json();
    } catch (err) {
      const rej = await Promise.reject(err);
      console.log(rej);
    }
  }
);
